import React from 'react';
import { Route, Redirect } from "react-router-dom";

const ProtectedRoute = (
    { 
    component: Component, 
    header: Header,
    footer: Footer,
    ...props }) => {
  return (
    <Route>
    {() => {
            if (props.loggedIn === true) {
                return (
                <>
                    <Header/> 
                    <Component {...props}/>
                    <Footer/>
                </>)
            } 
             else return <Redirect to="./register" />
        }
    }
    </Route>
)}

export default ProtectedRoute;
